import { useEffect, useState } from "react";
import { getPositions } from "../../services/users-api";


const UserForm = () => {
    const [positions, setPositions] = useState();

    useEffect(() => {
        getPositions()
        .then(positions => {
            setPositions(positions)})
        .catch(error => console.log(error))
    }, [])

    return(
        <form>
            <input name="name" autoComplete="off" placeholder="name"></input><br/>
            <input name="email" autoComplete="off" placeholder="email"></input><br/>
            <label>   
            <input name="phone" autoComplete="off" placeholder="phone"></input><br/>
            +38(XXX)-XXX-XX-XX
            </label>

            <p>Select your position</p>
            <ul>
            {positions && positions.map(({position}) => (
                <li>{position}</li>
            ))}
            </ul>
        </form>
    )
}

export default UserForm;
